'use strict';

var Caml_option = require("bs-platform/lib/js/caml_option.js");
var ReasonReact = require("reason-react/src/ReasonReact.js");
var ReactWhatsapp = require("react-whatsapp");

function make(number, message, element, children) {
  var tmp = { };
  if (number !== undefined) {
    tmp.number = Caml_option.valFromOption(number);
  }
  if (message !== undefined) {
    tmp.message = Caml_option.valFromOption(message);
  }
  if (element !== undefined) {
    tmp.element = Caml_option.valFromOption(element);
  }
  return ReasonReact.wrapJsForReason(ReactWhatsapp.default, tmp, children);
}

exports.make = make;
/* ReasonReact Not a pure module */
